	this.timeline.addTween(cjs.Tween.get(this.text_15).wait(238).to({_off:false},0).to({_off:true},129).wait(8).to({_off:false,x:836.7,y:131.2,text:"这几年前端技术发展很快，体现在四个方面：\n    1.开发语言技术，主要是ES6&7，coffeescript，typescript等；\n    2.开发框架，如Angular，React,Vue.js，Angular2等；\n    3.开发工具的丰富和前端工程化，像Grunt，Gulp，Webpack，npm，eslint，mocha这些技术；\n    4.前端开发范围的扩展，如服务端的nodejs,express,koa,meteor,GraphQL;移动端和跨平台的PhoneGap,ionic,ReactNative，Weex;计算机图形学和3维建模领域的WebGL(three.js等)；可视化与数据分析领域的d3.js等；包括浏览器不断开放的更多新特性和接口比如svg,canvas,蓝牙，电池，本地存储，service worker，Houdini等新的API能力，以及像WASM这样的底层优化技术；",color:"#FFFFFF",lineWidth:400},0).to({_off:true},41).wait(71).to({_off:false,x:414.5,y:165.5,text:"React-native\n   RN确实有效解决了传统客户端受限于发版周期、H5受限于性能的难题，做到了鱼和熊掌兼得的理想目标;\n   RN的出现带给了移动开发以独特的新视角，使得利用JavaScript开发Native成为了可能，NativeScript、Weex等类似的解决方案也发展开来。显然RN目前最大的问题仍然是不够成熟和稳定,期待发展。",color:"#999999",textAlign:NaN,lineHeight:19.5,lineWidth:506},0).wait(5).to({x:400.3,y:150.5,text:"Redux 与 Mobx\n   Redux 成功成为了 React 技术栈中的最重要成员之一。与Vue.js一样，Redux也是凭借着比其他Flux框架更简单易懂的API才能脱颖而出。不过已经很快有人开始厌烦它每写一个应用都要定义action、reducer、store以及一大堆函数式调用的繁琐做法了。\n\n   Mobx也是基于ES5 setter，让开发者可以不用主动调用action函数就可以触发视图刷新，它只需要一个store对象以及几个decorator就能完成配置，确实比Redux简单得多。",lineWidth:537},0).wait(5).to({x:388.2,y:303.1,text:"技术前沿",lineHeight:17,lineWidth:100},0).wait(5).to({x:391,y:199.9,text:"WebAssembly",lineHeight:19.5,lineWidth:294},0).wait(5).to({x:412.3,y:150.5,text:"WebComponents\n   当前的组件化，无不依赖于某一特定的框架环境，或者是Angular，或者是React，想移植就需要翻盘推倒重来，也就是说他们是不兼容的。有了WebComponents，作为浏览器厂商共同遵循和支持的标准，这一现状将极有可能被改写。",lineWidth:525},0).wait(5).to({x:416,y:164,text:"未来的Web前端开发体验一定是更丰富的，依托WebComponents的标准化组件体系，基于WebAssembly的高性能运行时代码，以及背靠HTTP/2协议的高速资源加载，前端工程师不必在性能上、兼容性上分散太多精力，从而可以专注于开发具备丰富式交互体验的下一代Web APP。",lineHeight:17,lineWidth:575},0).to({_off:true},5).wait(43).to({_off:false,x:103.3,y:111.6,text:"Lifecycle Methods\n\nMounting\nconstructor()\ncomponentWillMount()\nrender()\ncomponentDidMount()\n\nUpdating\ncomponentWillReceiveProps()\nshouldComponentUpdate()\ncomponentWillUpdate()\nrender()\ncomponentDidUpdate()\n\nUnmounting\ncomponentWillUnmount()",textAlign:0,lineHeight:19.5,lineWidth:261},0).wait(9).to({x:89.8,text:"ReactDom (Virtual DOM)\n\nReact events are named using camelCase, rather than lowercase.\n    With JSX you pass a function as the event handler, rather than a string.\n\nKeys help React identify which items have changed, are added, or are removed. Keys should be given to the elements inside the array to give the elements a stable identity\n    Keys Must Only Be Unique Among Siblings\n\ntextarea and select value prop;",lineWidth:603},0).to({_off:true},12).wait(12).to({_off:false,x:98.8,y:113.1,text:"Lifting State Up\n\n    Redux attempts to make state mutations predictable by imposing three restrictions on \nhow and when updates can happen.\n\n    Single source of truth\n\n    State is read-only\n\n    Changes are made with pure functions\n",lineWidth:614},0).wait(5).to({x:91.3,y:126.6,text:"Composition vs Inheritance\n    In React, this is also achieved by composition, where a more \"specific\" component \nrenders a more \"generic\" one and configures it with props.\n\n   At Facebook, we use React in thousands of components, and we haven't found any use \ncases where we would recommend creating component inheritance hierarchies.",lineWidth:625},0).wait(5).to({x:136.2,y:149,text:"Redux\n\n    Redux attempts to make state mutations predictable by imposing three restrictions on how and when updates can happen.\n\n    Single source of truth\n\n    State is read-only\n\n    Changes are made with pure functions",lineWidth:546},0).wait(5).to({x:83.1,y:118,text:"React-Upper （Dssg 项目实践）\n\n   Data:\n    Global.mark\n    Global.requestApi\n\n   Components:\n    DataList\n    AiForm\n    PageLoader\n    ...",lineWidth:648},0).to({_off:true},6).wait(36));
